window.bookSummaryJSON = "<p>\"If you want to stay, you have to play the game…\"<br> <br> Steele O’Brien is everything I hate in hockey players.<br> He’s cocky, brooding, antagonistic.<br> <br> I played his game, learned his secrets.<br> But that was before I found out he’s my new stepbrother.<br> <br> Now we’re at college together, and I can’t escape him.<br> Or his demons.<br> <br> It seems that, for him, the game isn’t over.<br> He says I'm his to play with. His to torment.<br> And he's determined to not only get under my skin, but carve his name into it.</p>"; 
